(1, 'Alia Bhatt', , 'Alia Bhatt is an Indian actress who appears in Bollywood films.​ She is the daughter of director, producer, and screenwriter Mahesh Bhatt and Soni Razdan, a film actress and director. She has one sister Shaheen Bhatt, a half sister Pooja Bhatt, and a half brother Rahul Bhatt. Actor Emraan Hashmi and director Mohit Suri are her cousins and producer Mukesh Bhatt is her uncle. Alia has completed high-school from Jamnabai Narsee School IB in May 2011.', '1993-03-15 00:00:00');
INSERT INTO `actors` (`id`, `name`, `image`, `bio`, `birth_date`) VALUES
(2, 'Varun Dhawan', , 'Varun Dhawan is an Indian actor working in Bollywood films. The son of film director David Dhawan, he studied Business Management in England, after which he worked as an assistant director to Karan Johar on the 2010 drama My Name Is Khan. Dhawan made his acting debut with Johar\'s 2012 romantic comedy Student of the Year, a box office success, for which he received a Filmfare nomination for Best Male Debut. In 2014, he starred as the protagonist of two commercially successful comedies— Main Tera Hero and Humpty Sharma Ki Dulhania.', '1987-04-24 00:00:00');
INSERT INTO `actors` (`id`, `name`, `image`, `bio`, `birth_date`) VALUES
(3, 'Shah Rukh Khan', , 'Shah Rukh Khan (born November 2, 1965) is a prominent Bollywood actor and producer. He made his film debut in Deewana (1992). In 2005, the Government of India honoured him with the Padma Shri for his contributions towards Indian Cinema.\r\n\r\nIn 2003, he founded the motion picture production company Red Chillies Entertainment together with his wife Gauri Khan.', '1965-02-11 00:00:00');

